import React, { Component } from 'react'

export default class Characteristics extends Component {
    render() {
        const {characteristicItems} = this.props;
        return (
            <div className="alert alert-info">
                {characteristicItems.length === 0 ? "No phones selected": <div>You have {characteristicItems.length} phones selected.</div>}
            </div>
        )
    }
}
